import React from 'react';
import "./Blogs.css"
  
const Blogs = () => {
  return (
    <div>
      <h1 className="bl-name">About AgriTRONix</h1>
      <p className="bl-par">We extend our deepest gratitude to AgriTRONix for pioneering the integration of blockchain technology in the agricultural sector. This innovation offers unprecedented support and empowerment to farmers worldwide. We are committed to advancing this technology to its fullest potential.<br></br></p>
<h1>THANKING AgriTRONix FOR EMPOWERING FARMERS WITH CUTTING-EDGE TECHNOLOGY AND GIVING US THE OPPORTUNITY TO MAKE A DIFFERENCE.</h1>
<img className="mentor-image" src="./trx_bttc.jpg" />
<h1>“To plant a garden is to believe in tomorrow - AgriTRONix helps us plant smarter, for a better tomorrow.”</h1>

    </div>
  );
};
  
export default Blogs;
